import React from "react";

const displayStyle = {
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  marginTop: 90,
};

const wineBottleStyle = {
  width: 100,
  height: "auto",
  marginTop: 20,
};

const soilStyle = {
  width: 150,
  height: 250,
  backgroundColor: "burlywood",
  borderRadius: 10,
  textAlign: "center",
  paddingTop: 40,
};

function Winebottle({ name, category, taste, producer, home }) {
  return (
    <div style={displayStyle}>
      <date>2020.7.1</date>
      <img
        style={wineBottleStyle}
        src="./wineBottleIcon.svg"
        alt="ワインボトル"
      />
      <div style={soilStyle}>
        <p>{name}</p>
        <p>{category}</p>
        <p>{taste}</p>
        <p>{producer}</p>
        <p>{home}</p>
      </div>
    </div>
  );
}

export default Winebottle;
